// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.16;

import "./DataTypes.sol";
import "./VotingCommon.sol";
import "./UserManager.sol";
import "./VotingStorage.sol";



contract VotingManager is VotingCommon {
    // set the data layer
    VotingStorage public votingStorage;
    UserManager public userManager;

    address public votingStorageAddress;
    address public userManagerAddress;

    function loadVotingStorage(address _votingStorageAddress) public {
        votingStorageAddress = _votingStorageAddress;
        votingStorage = VotingStorage(votingStorageAddress);
    }

    function loadUserManager(address _userManagerAddress) public {
        userManagerAddress = _userManagerAddress;
        userManager = UserManager(userManagerAddress);
    }

    // set the initial state of the contract
    constructor(
        address _admin,
        address _manager
    ) VotingCommon(_admin, _manager) {}


    // Function to add an university
    function addUniversity(University memory _university) public {
        require(
            userManager.isMemberUniversityManager(msg.sender),
            "Only University manager can update the University"
        );
        votingStorage.addUniversity(_university);
    }

    // Function to update an university
    function updateUniversity(University memory _university) public {
        require(
            userManager.isMemberUniversityManager(msg.sender),
            "Only University manager can update the University"
        );
        votingStorage.updateUniversity(_university);
    }


    // Function to get university detail
    function getUniversityDetail(bytes32 _universityId) public view returns (University memory) {
        return votingStorage.getUniversityDetail(_universityId);
    }

    /*
        Election OPERATIONS
    */

    // Function to create an election
    function addElection(Election memory _election) public {
        require(
            userManager.isMemberElectionManager(msg.sender),
            "Only election manager can add the election"
        );
        votingStorage.addElection(_election);
    }

    // Function to update an election
    function updateElection(Election memory _election) public {
        require(
            userManager.isMemberElectionManager(msg.sender),
            "Only election manager can update the election"
        );
        votingStorage.updateElection(_election);
    }

    // Function to get election details
    function getElectionDetail(
        bytes32 _electionId
    ) public view returns (Election memory) {
        return votingStorage.getElectionDetail(_electionId);
    }

    // Function to get election position details
    function getElectionPositionsDetail(
        bytes32 _electionId
    ) public view returns (bytes32[] memory) {
        return votingStorage.getElectionPositionDetail(_electionId);
    }

    // Function to get election starting time
    function getElectionStartingTime(
        bytes32 _electionId
    ) public view returns (uint256) {
        return votingStorage.getElectionStartingTime(_electionId);
    }

    // Function to get election ending time
    function getElectionEndingTime(
        bytes32 _electionId
    ) public view returns (uint256) {
        return votingStorage.getElectionEndingTime(_electionId);
    }

    /*
        POSITION OPERATIONS
    */

    // Function to create a position
    function addPosition(PositionDetail memory _positionDetail) public {
        require(
            userManager.isMemberElectionManager(msg.sender),
            "Only election manager can add the election"
        );
        votingStorage.addPosition(_positionDetail);
    }

    // Function to update a position
    function updatePosition(PositionDetail memory _positionDetail) public {
        require(
            userManager.isMemberElectionManager(msg.sender),
            "Only election manager can update the election"
        );
        votingStorage.updatePositionDetail(_positionDetail);
    }

    // Function to delete a position
    function deletePosition(bytes32 _positionId) public {
        require(
            userManager.isMemberElectionManager(msg.sender),
            "Only election manager can delete the election"
        );
        votingStorage.deletePosition(_positionId);
    }

    // Function to get position detail
    function getPositionDetail(
        bytes32 _positionId
    ) public view returns (PositionDetail memory) {
        return votingStorage.getPositionDetail(_positionId);
    }

    // Function to get position designation
    function getPositionDesignation(
        bytes32 _positionId
    ) public view returns (uint8) {
        return votingStorage.getPositionDesignation(_positionId);
    }

    // Function to get position candidates
    function getPositionCandidates(
        bytes32 _positionId
    ) public view returns (bytes32[] memory) {
        return votingStorage.getPositionCandidates(_positionId);
    }

    // Function to get per position maximum vote count
    function getPositionMaxVotes(
        bytes32 _positionId
    ) public view returns (uint256) {
        return votingStorage.getPositionMaxVote(_positionId);
    }

    /*
        OTHER OPERATIONS
    */

    // Function to add candidate in position
    function addCandidateInPosition(
        bytes32 _positionId,
        bytes32 _candidateId
    ) public {
        require(
            userManager.isMemberElectionManager(msg.sender),
            "Only election manager can add candidate in position"
        );
        votingStorage.addCandidateInPosition(_positionId, _candidateId);
    }


    // Function to delete candidate in position
    function deleteCandidateInPosition(
        bytes32 _positionId,
        bytes32 _candidateId
    ) public {
        require(
            userManager.isMemberElectionManager(msg.sender),
            "Only election manager can update candidate in position"
        );
        votingStorage.deleteCandidateInPosition(_positionId, _candidateId);
    }

    // Function for Vote Cast
    function voteCast(bytes32 _positionId, bytes32 _candidateId) public {
        Voter memory voter = userManager.getVoterDetailByAddress(msg.sender);
        PositionDetail memory position = getPositionDetail(_positionId);

        if (voter.voterId == "") {
            revert("Voter not found");
        }
        if (position.positionId == "") {
            revert("Position not found");
        }
        userManager.voteCast(_positionId, _candidateId);
    }

    // Function for position winner approval
    function resutlValidator(bytes32 _positionId) public {
        PositionDetail memory position = votingStorage.getPositionDetail(_positionId);
        if (position.positionId == "") {
            revert("Position not found");
        }
        require(
            userManager.isMemberAdmin(msg.sender) ||
            userManager.isMemberElectionManager(msg.sender) ||
                userManager.isMemberUserManager(msg.sender) ||
                userManager.isMemberUniversityManager(msg.sender),
            "Only these member can validate the functions"
        );
        for (uint8 i = 0; i < position.validatorsAddress.length; i++) {
            if (position.validatorsAddress[i] == msg.sender) {
                revert("Member already approved for result");
            }
        }
        votingStorage.validatePositionWinner(position.positionId);
    }

    // Function for position winner
    function positionWinner(bytes32 _positionId) public returns(bytes32){
        return votingStorage.positionWinner(_positionId);
    }
}
